"use strict";dotclear.ready((()=>{const e=dotclear.getData("smilieseditor");for(const t in e){const o=`smilieseditor_s${e[t].id}`;jsToolBar.prototype.elements[o]={type:"button",title:e[t].code,icon:e[t].icon,fn:{wiki(){this.encloseSelection(e[t].code,"")},xhtml(){this.encloseSelection(e[t].code,"")},wysiwyg(){const o=document.createTextNode(e[t].code);this.insertNode(o)}}}}}));
